struct Token
{
	string identify;
	string symble;
	int retPoint;
	Token(string id, string sym){identify = id;symble = sym;};
};
vector <Token> tokenStream;

int isTerminal(int x)
{
	if(endStr[x]=="")return 0;else return 1;
}

int lex(string rowStream)
{
	while(!tokenStream.empty())tokenStream.pop_back();
	string s = rowStream + " ";
	int len = s.length();
	int state = 0;
	string buff = "";
	vector <string> token;
	int numOfToken = 0;
	for(int i=0;i<len;i++)
	{
		int u = s[i];
		int nextState = dfa[state][u];
		if(nextState == -1)
		{
			if(isTerminal(state))
			{
				if(buff!="")
				{
					numOfToken++;
					Token temp(buff, endStr[state]);
					tokenStream.push_back(temp);
				}
				buff = "";
				state = 0;
				i--;
			}
			else
			{
				puts("error");
				return -1;
			}
		}
		else
		{
			state = nextState;
			if(s[i]!=' ' && s[i] != '\t')
			{
				buff += s[i];
			}
		}
	}
	return 1;
}



